import React  from "react";

const temas = [
    {
        "id":"Informatica",
        "sub": {
            "temas":""
        }
    },
    {
        "id":"Concepto",
        "sub":"HOLA"
    }
]

const titulos_temas = temas.map((type) =>{
    return type.id
});
console.log(titulos_temas)
export function Nav(){
    return(
        <React.StrictMode>
            <ul>
                {
                    temas.map(type =>{
                        return(
                            <li>
                                {type.id}
                                <ul>
                                    <li value={type.sub.temas}>
                                        {type.sub.temas}
                                    </li>
                                </ul>
                            </li>
                        )
                    })
                }
            </ul>
        </React.StrictMode>
    )
}
